import React from 'react';
import Router, { Route } from 'react-router-dom';
import Home from './page/Home';
import ErrorPage from './page/ErrorPage';

function App() {
  return (
    <React.Fragment>
      <Router>
        <Route exact path="/" component={ Home } />
        <Route component={ ErrorPage } />
      </Router>
    </React.Fragment>
  );
}

export default App;
